        entry.setName(name);
        entry.setUserId(userId);
        entry.setFileSize(fileSize);
    }

    public String getEntryName() {
        return entry.getName();
    }

    public int getUserId() {
        return entry.getUserId();
    }

    public long getFileSize() {
        return entry.getFileSize();
    }
}

